import React from 'react';
import styled from 'styled-components';

const Col = styled.div`
  background-image: url(${props => props.img});
  border: solid 1px #000;
  border-radius: 4px;
  height: 70px;
  width: 70px;
  margin: 1px;
  cursor: pointer;
  :hover {
    background-color: #ccc;
  }
`;

const Square = ({ id, color, changeColor }) => {  
  console.log(color === "#6af");
  return (
    <div>
      <Col id={ id }
           onClick={ changeColor }
           img={ color === "#6af" ? 'https://external-content.duckduckgo.com/iu/?u=http%3A%2F%2Fcdn.onlinewebfonts.com%2Fsvg%2Fimg_419410.png&f=1&nofb=1' : 
                 color === "#f6c" ? '../O.pnghttps://external-content.duckduckgo.com/iu/?u=https%3A%2F%2Fimg.pngio.com%2Fo-png-89-images-in-collection-page-2-png-o-2000_2000.png&f=1&nofb=1' :
                 color === ""
                }
      >
      </Col>          
    </div>
  );
}

export { Col, Square }
